import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from 'react-bootstrap';

const HelpSidebar = () => {
  return (
    <div className="mb-3">
      <div className="list-group">
        <a className="list-group-item list-group-item-action active" role="button">
          Ay√∫danos
        </a>
        <Button as={Link} to="/register" className="list-group-item list-group-item-action">
          Adopta o acoge
        </Button>
        <Button as={Link} to="/register" className="list-group-item list-group-item-action">
          Hazte socio o padrino
        </Button>
        <Button as={Link} to="/register" className="list-group-item list-group-item-action">
          Hazte voluntario
        </Button>
        <Button as={Link} to="/register" className="list-group-item list-group-item-action">
          Difunde
        </Button>
        <a href="#" className="list-group-item list-group-item-action">Tienda Solidaria</a>
        <a href="#" className="list-group-item list-group-item-action">Contacta con nosotros</a>
      </div>
    </div>
  );
};

export default HelpSidebar;
